  [],\n\t\"revision_timestamp\": \"2016-07-27T22:45:13.567797\",\n\t\"name\": \"gopher-tortoise-survey-population-evaluation-and-habitat-suitability-final-report-to-georg\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report desribes methods and results
  of the line transect distance sampling approach used to derive baseline gopher tortoise
  population estimates at 20 sites throughout Georgia. Line transect distance sampling
  (LTDS; Buckland et al. 2001, Buckland et al. 2004) was used to derive baseline gopher
  tortoise population estimates (density and abundance) at 20 sites identified in
  the 2007 Request for Proposals (Table 1) and to identify potential habitat and population
  management options for the sites. Survey data from a sub-set of these sites were
  used to compare estimates derived using LTDS to estimates obtained using area-constrained
  (belt transect) methods as proposed in Floridau2019s Gopher Tortoise Management
  Plan (FFWCC 2007).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
